
const delay = (ms) => new Promise(resolve => setTimeout(resolve, ms));

/**
 * @param {Function} fetchSongLyrics
 */
async function runAllFetches(currLinksList , fetchSongLyrics) {
  for (const link of currLinksList) {
    
    const randomDelay = Math.floor(Math.random() * 12001) + 3000;

    await fetchSongLyrics(link.url);

    await delay(randomDelay);
  }
}

